import React, {Component, useState, useEffect} from 'react';
import "./App.css"
import {
    BrowserRouter,
    Switch,
    Route,
    Link,
    useParams,
    useRouteMatch
} from "react-router-dom";

const [priziv, setPriziv] = useState([]);

useEffect(() => {
        fetch(`http://127.0.0.1:8000/prizivniki/`)
            .then(response => response.json())
            .then((result) => {
                setPriziv(result);
            })
    }, []);

function Priziv() {

    return (
        <div>
            <Link to="/priziv">Призывники</Link>
            <div className={"assortment"}><h1>Призывники</h1><br/></div>
            <div className={"priziv_list"}>

                {priziv.map(item => (
                    <div className={"priziv"} key={"surname:" + priziv.surname}>
                        <Link to={`/priziv/${priziv.pk}/`}>{priziv.surname} {priziv.name}<br/></Link>
                        <a>Наличие отсрочки: {priziv.otsrochka}<br/><br/></a>
                    </div>
                ))}
            </div>
        </div>


    );
}
export default Priziv;
